import React from "react";
import { Notch, ToggleWrapper } from "../style/ToggleButton.style";

const ToggleButton = ({
  onToggle,
  children,
  disabled,
  className,
  fullWidth,
  ...otherProps
}) => {
  return (
    <ToggleWrapper onClick={onToggle}>
      <Notch active={false} />
    </ToggleWrapper>
  );
};

export default ToggleButton;
